CREATE TABLE `fotogalerie` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `album_url` varchar(255) NOT NULL,  `album_name` varchar(255) NOT NULL,  `album_description` text NOT NULL,  `creation_date` date NOT NULL,  `author` varchar(255) NOT NULL,  PRIMARY KEY (`id`),  UNIQUE KEY `AlbumName` (`album_name`)) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;
CREATE TABLE `gallery_images` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `album_id` int(11) NOT NULL,  `image` varchar(255) NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=232 DEFAULT CHARSET=latin1;
CREATE TABLE `news` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `article_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  `author` int(11) NOT NULL,  `tags` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  `article` longtext COLLATE utf8_unicode_ci NOT NULL,  `release_date` date NOT NULL,  `thumbnail` mediumtext COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`id`),  UNIQUE KEY `article_url` (`article_url`)) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;
CREATE TABLE `news_tags` (  `id` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
CREATE TABLE `ooemm_archive` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `year` varchar(10) COLLATE utf8_unicode_ci NOT NULL,  `table_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  `table_row` int(11) NOT NULL,  `c_pl` int(11) NOT NULL,  `c_verein` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  `c_rd` int(11) NOT NULL,  `c_s` int(11) NOT NULL,  `c_u` int(11) NOT NULL,  `c_n` int(11) NOT NULL,  `c_spiele` varchar(10) COLLATE utf8_unicode_ci NOT NULL,  `c_satze` varchar(10) COLLATE utf8_unicode_ci NOT NULL,  `c_pkt` int(11) NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=365 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
CREATE TABLE `page_content` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `page` varchar(200) COLLATE utf8_unicode_ci NOT NULL,  `paragraph_index` int(11) NOT NULL,  `text` text COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
CREATE TABLE `settings` (  `setting` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  `value` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`setting`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
CREATE TABLE `sponsors` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `name` varchar(200) COLLATE utf8_unicode_ci NOT NULL,  `link` varchar(200) COLLATE utf8_unicode_ci NOT NULL,  `image` varchar(200) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
CREATE TABLE `users` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `username` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  `firstname` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  `lastname` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  `sex` varchar(10) COLLATE utf8_unicode_ci NOT NULL,  `email` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  `password` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
CREATE TABLE `vorstand` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `darstellung` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  `bereich` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  `email` varchar(150) COLLATE utf8_unicode_ci NOT NULL,  `telefon` varchar(20) COLLATE utf8_unicode_ci NOT NULL,  `foto` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`id`)) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;
