INSERT INTO `news` VALUES('1', 'Hobbynachwuchsturnier-in-Altmuenster', 'Hobbynachwuchsturnier in Altmünster', '0', 'Nachwuchs||Top-News||', '<h2>Hobbynachwuchsturnier in Altmünster</h2><p><img width=\"317\" height=\"180\" src=\"data:image/png;base64,\" alt=\"\" srcset=\"http://www.badminton-ooe.at/wp-content/uploads/MFX8829.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/MFX8829-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/MFX8829-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>19 Teilnehmer/-innen aus 6 Vereinen fanden den Weg nach </strong><br><strong>Altmünster zum heurigen Hobbynachwuchsturnier. Auch</strong><br><strong> heuer war die Austragung vorerst wieder fraglich. Erst nach </strong><br><strong>Urgenzen kam die notwendige Teilnehmerzahl zustande, wobei </strong><br><strong>ATV-Andorf maßgeblich dazu beitrug (5 Teilnehmer/innen), dass </strong><br><strong>doch ein ausgeglichenes Turnier zustande kam. Erfreulich war, </strong><br><strong>dass nicht nur Betreuer sondern auch Familien der Spieler/innen</strong><br><strong> mitgekommen waren.</strong></p><p>Leider konnte kein U13 Bewerb bei den Mädchen gespielt werden. <br>Das einzige U11 Mädchen (Mayer Babette; Sportunion Altmünster) <br>spielte deshalb bei den U15 Mädchen, wobei sie sich einen beachtlichen 2. Platz erkämpfte.</p><p>Für sehr viele Teilnehmer/innen war es wieder die erste Turniererfahrung, was ja auch Sinn der Veranstaltung sein soll.</p><p>Eric Hayböck (BC-Windischgarsten) spielte 2 Altersklassen höher und siegte auch auch dort nach spannenden Matches in <br>der U15 Klasse. Weitere Platzierungen in U15: 2.Pl. Florian Höller (Sport-Union Altmünster); 3.Pl. Noah Putz (Sport-Union Altmünster); <br>4.Pl. Kaltenbrunner Moritz (Union Ohlsdorf)</p><p>Bei den U11 DE siegte die schon etwas spielerfahrene Dalila Sekeric (Sportunion Altmünster). Weitere Platzierungen: <br>2.Pl. Dana-Lynn Grafinger (Union Urfahr); 3.Pl. Jasmin Eder (ATV-Andorf);</p><p>Bei den U11 HE dominierte ganz klar Alexander Puschl aus Ohlsdorf. Weitere Platzierungen: 2.Pl. Florian Kreiseder <br>ebenfalls aus Ohlsdorf; 3.Pl. Max Baumgartner (BC-70 Linz); 4.Pl. Richard Feitzlmayr (ATV Andorf) 5.Pl. <br>Felix Kirchberger (ATV-Andorf)</p><p>Bei den U13 HE konnte sich Neueinsteiger Höller Andreas (Sport-Union Altmünster) den 1. Platz sichern. Weitere <br>Platzierungen : 2.Pl. Felix Neuhuber (Sport-Union Altmünster); 3.Pl. Bachmayer Tobias (ATV-Andorf)</p><p>Bei den U15 DE siegte ebenfalls Hanna Neuhuber (Sport-Union Altmünster), ebenfalls Neueinsteigerin. Weitere <br>Platzierungen: 2.Pl. Babette Mayer (Sport-Union Atmünster); 3.Pl. Marlene Stein (Sport-Union Altmünster); 4.Pl. <br>Viktoria Feitzlmayr (ATV-Andorf)</p><p><em>Zum Abschluss des Turniers gab es auch noch eine Tombola.<br>Auf Grund der sommerlichen Temperaturen wurden alle Spieler/innen mit einem Eis belohnt.</em></p><p><strong>[Bericht: Peter Kickinger]</strong></p>', '2018-05-30', 'data:image/jpeg;base64,');
INSERT INTO `news` VALUES('2', '7-OOeBV-Doppel-RLT-DD-HD-MD-in-Haid', '7. OÖBV Doppel-RLT (DD, HD, MD) in Haid', '0', 'OEBV-RLT||Top-News||', '<h2>7. OÖBV Doppel-RLT (DD, HD, MD) in Haid</h2><p><img width=\"317\" height=\"180\" src=\"data:image/png;base64,\" alt=\"\" srcset=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_7_OÖBV_Doppel-RLT_27.05.2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_7_OÖBV_Doppel-RLT_27.05.2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_7_OÖBV_Doppel-RLT_27.05.2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii\"></p><p><strong>Am Sonntag den 27. Mai, bei sonnigem und warmen Sommertemperaturen, war abermals die Sporthalle Haid der Austragungsort für ein Turnier der OÖBV-Doppel-Turnier-Serie. Die Entscheidung bei diesem Mischturnier auf kurze Sätze mit Verlängerung bis maximal 20 Punkte zu spielen hat sich bewährt und macht Sinn.</strong></p><p>Unter den 56 Teilnehmer/Innen aus 19 verschiedenen Vereinen waren einige junge sowie viele junggebliebene mit Begeisterung beim Matchen. 8 Damen-Doppel, 18 Herren-Doppel und ebenfalls 18 Mixed-Doppel lieferten sich auf 6 Spielfeldern schweißtreibende, spannende und leider nicht ganz verletzungsfreie Spiele. Auf diesem Wege eine baldige Genesung für Tina Plank und Gaby Götzinger.<br>Das Turnier startete um 10:00 Uhr und wurde mit der Mixed-Siegerehrung um 18:30 Uhr beendet. Alle Gewinner/Innen sind in der <a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=EFD2F585-D638-4E1A-9FE1-E6D4BA4786AA\"><em><strong>Tournamentsoftware</strong></em></a> ersichtlich.</p><p><em>Ein herzliches und großes DANKE, an alle Teilnehmer/Innen sowie an meine Helferlein Roswitha, Kerstin, Klaus und Josef vom ASK Nettingsdorf-Badminton/Racketlon für den guten Turnierablauf. Die Turnieranmeldung per PC kurz „TA“ genannt oder die „TA-App“ für Smartphone, IOS oder Android wird für die nächsten Turniere im Herbst so Mitte September wieder aktiv geschaltet sein.</em></p><p><strong>[Bericht: Peter Krenmayr]</strong></p>', '2018-05-30', 'data:image/jpeg;base64,');
INSERT INTO `news` VALUES('3', 'Mitgliederversammlung-2018', 'Mitgliederversammlung 2018', '0', 'Verbandsintern||Top-News||', '<h2>Mitgliederversammlung 2018</h2><p><img width=\"317\" height=\"180\" src=\"data:image/png;base64,\" alt=\"\" srcset=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_0946.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_0946-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_0946-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Die Mitgliederversammlung 2018 war heuer sehr gut besucht. 19 Vereine (teilweise in mit großer Abordnung) diskutierten über die letzten 3 Jahre und über zukünftige Themen. Auch ÖBV Präsident Harald Starl kam direkt von den Thomas & Uber Cup Finals zur Mitgliederversammlung. Er konnte in seinem sehr interessanten Kurzvortrag von den (nicht beschlossenen) Regeländerungen der Generalversammlung des BWF in Bangkok berichten. Außerdem gab er Eindrücke vom Thomas & Uber Cup an die Teilnehmer der Mitgliedersammlung weiter.</strong></p><p>Folgende Themen wurden besprochen:</p><p>Genehmigung des Protokolls der letzten Jahreshauptversammlung – einstimmig (31 Stimmen)<br>Ehrung der Mannschaftsmeister der Saison 2017-2018 der Ligen<br>Rechenschaftsbericht des Verbandsvorstandes Bericht der Kontrolle, Entlastungsantrag und Abstimmung<br>Behandlung satzungsmäßig vorliegender Anträge<br>Bericht des Wahlkomitees mit Durchführung der Wahl des Verbandsvorstandes, der Kontrolle und der Mitglieder des Schiedsgerichtes<br>Vorschau auf die nächste Saison<br>Allfälliges</p><p><strong>Es wurden neue Mitglieder in den Vorstand gewählt und der bisherige Vorstand erneut gewählt. Der neue Vorstand ist bereits auf der Homepage veröffentlicht. Neu im Team sind Peter Krenmayr (Breitensportreferent), Stephan Dlapka (Nachwuchsreferent), Markus Eckersberger (Schiedsrichterreferent) und Peter Schwarzmann (Marketing).</strong></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>', '2018-05-30', 'data:image/jpeg;base64,');
