INSERT INTO `page_content` VALUES('28', 'senioren', '1', '<p><h3>Serior Master 2016</h3>Der ober&ouml;sterreichische Badmintonverband und der Veranstalter Ask&Ouml; Traun richten das 4. O&Ouml;BV Senior Masters 2016 aus. Das Turnier ist ein reines Doppelturnier und wird am Samstag 14. Mai bis Sonntag 15. Mai 2016 ausgetragen. Ein besonderes Highlight wird die Players-Party mit Tombola und Tischzauberei sein. Nachfolgend die Details.</p><p>Veranstalter: Ober&ouml;sterreichischer Badminton Verband<br>Ausrichter: ASK&ouml; Traun, www.badminton-traun.at<br>Austragungsort: Bundesschulzentrum Traun, Schulstra&szlig;e 59/Eingang Kreuzfeldstra&szlig;e 7, 4050 Traun <br>7 Spielfelder</p><p>Termin: Samstag, 14. Mai 2015 - Sonntag, 15. Mai 2016<br>Beginnzeit: 10:00 Uhr (Samstag), 09:30 Uhr (Sonntag)<br>Turnierablauf: Beginn mit MXD.<br>Nach der Auslosung wird der Ablauf im Internet bekannt gegeben. Bewerbe: HD, DD und MXD<br></p><p>Alterslimit: Die TeilnehmerInnen m&uuml;ssen vor dem 1.1.1981 geboren sein (&uuml;ber 35 Jahre)<br>Altersklassen: z&auml;hlt das Gesamtalter der Paarung: 70+, 80+, 90+, 100+, 110+, 120+, 130+ (z.B. TeilnehmerIn-1: 35 Jahre und TeilnehmerIn-2: 40 Jahre = Altersklasse 70+)<br>Wenn in einer Altersklasse weniger, als 4 Teilnehmer gemeldet sind, werden Altersklassen zusammengezogen.<br>Spielmodus: Jede Paarung in der gegebenen Disziplin hat mind. 3 Spiele. Bei 4 bis 5 TeilnehmerInnen in der Altersklasse spielt jeder gegen jeden.<br>B&auml;lle: m&uuml;ssen von den Teilnehmern gestellt werden. Als Richtlinie gilt die Ballzulassung des &ouml;BV. Andere B&auml;lle, z.B. Kunstoffb&auml;lle sind nur dann erlaubt, wenn der Gegner einverstanden ist.<br>Nennungen: An Ask&Ouml; Traun Badminton: herbert.koch@gmx.at oder auf www.badminton-traun.at<br>Spielerlizenz nicht unbedingt erforderlich!<br>Nennschluss: Montag, 9. Mai 2016<br>Nenngeld: &euro; 10,- pro Teilnehmer/in, je Bewerb<br></p><p>Auskunft: Herbert Koch, herbert.koch@gmx.at , 0664-240 75 56<br>Preise: Pokale f&uuml;r SiegerInnen, Medaillen und Urkunden f&uuml;r Platzierte, Sachpreise&Uuml;bernachtung: Hotel Almtalerhof***, Leerwies 1, 4050 Traun, 07229-733 01-0, almtalerhof@aon.at, www.almtalerhof.at</p><br><br>');
INSERT INTO `page_content` VALUES('29', 'senioren', '2', '<p><h3>Serior Master 2015</h3><b>Doppelturnier der besonderen Art</b><br>Veranstalter: Ober&ouml;sterreichischer Badminton Verband</p><p>Ausrichter: <b>ASK&Ouml; Traun</b></p><p>Austragungsort:<br><b>Bundesschulzentrum Traun</b> - 7 Spielfelder (Eingang Kreuzfeldstra&szlig;e 7)</p><p>Termin:<br><b>Samstag, 2. Mai 2015 - Sonntag, 3. Mai 2015</b></p><p>Beginnzeit:<br>10:00 Uhr (Samstag), 09:30 Uhr (Sonntag)</p><p>Turnierablauf:<br>Beginn mit MXD. Nach der Auslosung wird der Ablauf im Internet bekannt gegeben.</p><p>Bewerbe: HD, DD und  MXD</p><p>Link zur Tournamentsoftware:<br><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=A2232258-138D-48C0-87E1-A4BCB8A3A3A1\">Tournamentsoftware</a></p><p>Alterslimit:<br>Die Teilnehmer m&uuml;ssen vor dem 1.1.1980 geboren sein (&uuml;ber 35 Jahre)</p><p>Altersklassen:<br>z&auml;hlt <b>das Gesamtalter der Paarung</b>: 70+, 80+, 90+, 100+, 110+, 120+, 130+<br>(z.B. Teilnehmer-1: 35 Jahre und Teilnehmer-2: 40 Jahre = Altersklasse 70+)<br>Wenn in einer Altersklasse weniger, als 4 Teilnehmer gemeldet sind, werden 2 Altersklassen zusammengezogen.</p><p>Spielmodus:<br>Jede Paarung in der gegebenen Disziplin hat mind. 3 Spiele. Bei 4 bis 5 Teilnehmern in der Altersklasse spielt jeder gegen jeden. Sonst wird nach Schweizer System gelost</p><p>B&auml;lle:<br>m&uuml;ssen von den Teilnehmern gestellt werden. Als Richtlinie gilt die Ballzulassung des &Ouml;BV.</p><p>Nennungen:<br>direkt, vom Verein oder Verband an das Sekretariat des O&Ouml;BV: <a href=\"mailto: ooe-badmintonverband@aon.at\">ooe-badmintonverband@aon.at</a></p><p>Nennschluss: <b>Montag, 27. April 2015</b></p><p>Nenngeld: &euro; 10,- pro Teilnehmer, je Bewerb</p><p><b>Auslosung: Donnerstag, 30. April 2015</b></p><p>Turnierleitung: ASK&Ouml; Traun</p><p>Oberschiedsrichter: Klaus Mitterhauser, Janos Halasz</p><p>Auskunft: Herbert Koch - <a href=\"mailto: herbert.koch@gmx.at\">herbert.koch@gmx.at</a> - Handy 0664 2407556</p><p>&Uuml;bernachtung: Hotel Almtalerhof***, Leerwies 1, 4050 Traun, Tel. +43/7229/73301-0, <a href=\"mailto: almtalerhof@aon.at\">almtalerhof@aon.at</a> - <a href=\"https://www.almtalerhof.at/\">www.almtalerhof.at</a></p><p>Players Party: Samstag ca. 20:00 Uhr im Bundesschulzentrum mit Rahmenprogramm (Unkostenbeitrag &euro; 10,- f&uuml;r Speisen/Getr&auml;nke)</p><br><br><p>');
INSERT INTO `page_content` VALUES('30', 'senioren', '3', '<h3>Serior Master 2012</h3>Am 26./27.10.20112 fand bereits das zweite Senior Masters statt. Spielberechtigt waren alle Senioren ab 35 Jahre. 41 Teilnehmer aus 6 Bundesl&auml;ndern fanden sich am Nationalfeiertag in Linz/Urfahr ein.</p><p><b>Sieger:<br>Herrendoppel:</b><br>HD 70 : Tarek El Dabbagh + Gerhard Mayr<br>HD 100: Wolfgang Luber + Max Pichler<br>HD 109: Joachim Bergner + Walter Struger<br>HD Senior Super Finals: Tarek El Dabbagh + Gerhard Mayr</p><p><b>Damendoppel:</b><br>DD 80: Anja Friedrich + Elisabeth Pr&ouml;ll</p><p><b>Mixdoppel:</b><br>MD 70: Harald Friedrich + Anja Friedrich<br>MD 100: Harald Starl + Waltraud Kronsteiner</p><p><a href=\"http://obv.tournamentsoftware.com/sport/winners.aspx?id=CE262E3F-47CF-4FE5-AF0F-60698D930C67\">Tournamentsoftware</a></p><br><br>');
INSERT INTO `page_content` VALUES('31', 'senioren', '4', '<p><h3>Serior Master 2011</h3>Am 26.10.2011 fand, angeregt durch den O&Ouml;BV-Seniorenreferenten Janos Halasz, das erste Senior Masters in Neuhofen statt. Es sollte ein &Ouml;sterreich weites Turnier f&uuml;r den Altersbereich ab 35 Jahren durchgef&uuml;hrt werden.47 Teilnehmer aus 7 Bundesl&auml;ndern fanden sich am Nationalfeiertag in Neuhofen in einem mit den ) 9 Landesfahnen sch&ouml;n geschm&uuml;ckten Turnsaal ein.Die Er&ouml;ffnung machte Gerhard Brunnbaur (Union Vorstandsmitglied aus Neuhofen), der in seiner Ansprache &auml;u&szlig;erst lobend erw&auml;hnte, welch tolle Idee diese bundesl&auml;nder&uuml;bergreifende Veranstaltung sei. Anschlie&szlig;end begr&uuml;&szlig;te auch der Pr&auml;sident des O&Ouml;-Badmintonverbandes Herbert Koch die anwesenden Teilnehmer und Rabel Andreas er&ouml;ffnete dieses erste Senioren Masters.Wie in der Ausschreibung schon erw&auml;hnt wurde das Alter der beiden Spieler zusammengez&auml;hlt und so kamen die einzelnen Klassen zustande.Klaus Mitterhauser unterst&uuml;tzte uns am PC.</p><p><b>Sieger:<br>Herrendoppel:</b><br>HD 70 : Markus Piribauer + Thanh Tran<br>HD 90: Wolfgang Dornig + Peter Krenmayr<br>HD 100: Joachim Berger + Walter Struger<br>HD 110: Peter Golazewski + Johannes Lenhart</p><p><b>Damendoppel:</b><br>DD 80: Karin Steinbichler + Susanne Swoboda<br>DD 100:Alexandra Pelz + Sylvia Weiss</p><p><b>Mixdoppel:</b><br>MD 70: Markus Piribauer + Karin Steinbichler<br>MD 100: Karl Pr&ouml;ll + Elisabeth Pr&ouml;ll<br>MX 110: Walter Struger + Hilde Kreulitsch</p><p><b>MX 100 Super Finale: Pr&ouml;ll/Pr&ouml;ll - diese Paarung gewann den ersten fl&uuml;ssigen 0,33 Liter Pokal gesponsert von Eggenberger Bier</b></p><p>Turnierende war gegen 16 Uhr mit Siegerehrung und gemeinsamen Foto.</p><p>Falls jemand Lust hat, sich Fotos vom Turnier mailen zu lassen, bitte kurzes Mail an: <a href=\"mailto: lind.p@aon.at\">lind.p@aon.at</a></p><p>Janos danken wir f&uuml;r seine gute Idee und den Teilnehmern f&uuml;r ihr faires Verhalten. Wir hoffen, dass dieses ins Leben gerufene Senioren Masters weiterhin bestehen bleibt und sich in Zukunft auch Veranstalter daf&uuml;r finden. Danke auch unseren zwei jungen Damen am Buffet, die ihre Aufgabe toll gemeistert haben.</p><p><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=02C0AF40-8F72-4A6E-9D73-90B74AB0489C\">Spiele auf der Tournamentsoftware</a><br>Bericht: Peter Lindner/UBC Neuhofen</p><br><br>');
INSERT INTO `page_content` VALUES('32', 'senioren', '5', '<p><h3>&Ouml;M Senioren 2010</h3>Bericht &uuml;ber die <b>&Ouml;sterreichische Senioren Meisterschaft</b><br>Judenburg, 27-28.November 2010-12-06</p><p>Aus Ober&ouml;sterreich sind folgende Spieler dort gewesen:</p><p>BSC 70 Linz: Ursula Edelm&uuml;ller Andreas B&ouml;hm<br>Sabine Salzer Janos Halasz<br>Harald Hochgatterer<br>Wolfgang Sternberger</p><p>Nettingsdorf: Josef Handlechner<br>Peter Krenmayr</p><p>Union Urfahr: Martin Grafinger<br>Gerhard Mayr</p><p>Vorchdorf: Waltraud Kronsteiner<br>Harald Starl</p><p>Die Ergebnisse:<br>Hochgatterer H.: 1. Platz HE 35+ 1. Platz HD 35+ 2. Platz MX 35+<br>B&ouml;hm A: 2. Platz HD 40+<br>Halasz J: 3. Platz HE 60+<br>Edelm&uuml;ller U: 2. Platz MX 35+</p><p>Handlechner J: 1. Platz HD 45+ 3/4. Platz HE 45+<br>Krenmayr P: 1. Platz HD 45+ 1. Platz HE 45+</p><p>Mayr G: 2. Platz HD 40+ 3/4. Platz HE 45+</p><p>Starl H: 1. Platz HD 35+ 2. Platz HE 45+ 1. Platz MX 45+<br>Kronsteiner W: 1. Platz DD 45+ 1. Platz DE 50+ 1. Platz MX 45+</p><p>Janos Halasz, Seniorenreferent des O&Ouml;BV</p>');
INSERT INTO `page_content` VALUES('33', 'schriedsrichter', '1', '<p><b>Schiedsrichter an der &Ouml;sterreichische Staatsmeisterschaft, Linz 5-7.Feb.2010</b></p><p>Vom &Ouml;BV: Klaus Schlieben (BWF), Ewald Cejnek (BE), Michael Steiner.</p><p>Aus Tschechien kommt: Jana Honnerova (BE)</p><p>Vom O&Ouml;BV: Karl Pr&ouml;ll, Andi Rabel, Klaus Mitterhauser, Steiner Reinhard, Andi B&ouml;hm, Reinhard Hechenberger, Michael Giel. Wahrscheinlich noch Hans Gr&uuml;n, als alt-neuer SR!</p>');
INSERT INTO `page_content` VALUES('34', 'schriedsrichter', '2', '<p><u>Freitag</u>:   Schlieben, Cejnek, Steiner, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Giel, Rabel, Gr&uuml;n (?)<br><u>Samstag</u>: Schlieben, Cejnek, Honnerova, Steiner, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Rabel, Gr&uuml;n (?)<br><u>Sonntag</u>: Cejnek, Steiner, Honnerova, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Giel, Rabel, Gr&uuml;n (?)</p><p>Laut Verordnungen des &Ouml;BV werden alle Spiele geschiedst, Aufschlagsrichter und Linienrichter kommen ab Semifinale in Einsatz.<br>Kleidung f&uuml;r die Schiedsrichter: olivengr&uuml;nes Polo / Pullover, schwarze Hose, Schuhe, dunkle Socken.</p><p>Die Schiedsrichter Kollegen werden wahrscheinlich auch die Linienrichter Funktionen ab und zu &uuml;bernehmen - m&uuml;ssen.</p><p>Freitag kommt Michael Nemec vom &oOuml;BV Schiedsrichterreferat, der die Arbeit der Schiedsrichter vom O&Ouml;BV unter die Lupe nimmt und wird uns sicher gute Ratschl&auml;ge geben. Nach dem Ende der Spiele am Freitag - voraussichtlich nach 22:00 - organisieren wir ein gemeinsames Treffen mit ihm, in seinem Hotel. ALLE Schiedsrichter sind gebeten daran teil zu nehmen. Samstag haben wir zw. ca. 12:20 - 13:00 eine Pause geplant. Michael m&ouml;chte, dass wir diese Pause gemeinsam verbringen.</p><p>Janos Halasz, Referee an den &Ouml;M</p>');
INSERT INTO `page_content` VALUES('35', 'schriedsrichter', '3', '<p><b>Ausbildung von Linienrichtern (LR)</b></p><p>Im Rahmen der Landesnachwuchsmeisterschaft (23-24.Januar 2010) werden Spieler (und Interessenten) zu Linienrichtern ausgebildet. Die Ausbildung wird vom internationalen Schiedsrichter des &Ouml;BV, Janos Halasz durchgef&uuml;hrt.</p><p>Die genaue Arbeit der Linienrichter wird erkl&auml;rt, die m&ouml;glichen Fehler, das Verhalten am Spielfeld,die Zusammenarbeit der LR mit dem Schiedsrichter, die Konflikte zwischen Spieler <-> LR.</p><p>Die ausgebildeten LR werden die M&ouml;glichkeit haben in den Semifinalen und Finalen der &Ouml;sterreichischen Staatsmeisterschaft (7.Februar 2010, in Solar City) eingesetzt zu werden.</p><p>Ort der Ausbildung: Bundesschulzentrum (BSZ), Traun</p><p><b>Pages</b>: 1 <a href=\"schiedsrichter_page2\">2</a></p>');
INSERT INTO `page_content` VALUES('36', 'schiedsrichter_page2', '1', '<p><b>Schiedsrichter f&uuml;r Jugend &Ouml;M (U17-U19) in Judenburg (12-14.Feb) dringend gesucht</b></p><p>Liebe Sportkollegen,<br>der Zeit und Interesse h&auml;tte soll mich bei mir melden. Das Turnier ist sehr interessant, man kann spannende Spiele erwarten und die Spieler von morgen gleich beobachten.<br>Die Stimmung ist gut, die Halle vom Quartier nur 10 min. zu Fu&szlig; weit. Judenburg ist mit Zug / Auto gut erreichbar. Zahlung, Verpflegung - wie &uuml;blich.</p><p>Janos Halasz, Referee an der &Ouml;M U17-U19   (Mail: <a href=\"mailto: janos_halasz@hotmail.com\">janos_halasz@hotmail.com</a>)</p>');
INSERT INTO `page_content` VALUES('37', 'schiedsrichter_page2', '2', '<p><b>Neue Einstufung f&uuml;r die Schiedsrichter vom O&Ouml;BV</b></p><p>im SR-Referat haben wir eine Struktur &uuml;berlegt und entsprechend der Erfahrung, K&ouml;nnen, usw. haben wir die Schiedsrichter in 4 Stufen (Gruppen) eingeteilt:</p><p><u>Kat. A</u>: der SR in dieser Gruppe darf Spiele der <span style=\"color: #FF0000\">1. BL</span> (<b>auch Heimverein</b>) schiedsen. Diese Kategorie entspricht den national gehobenen Aufgaben (ngA).<br><u>Kat. B</u>: der SR in dieser Gruppe darf Spiele der <span style=\"color: #FF0000\">1. BL</span>, wie auch der 2.BL (auch Heimverein) schiedsen.<br><u>Kat. C</u>: der SR in dieser Gruppe darf Spiele der 2.BL schiedsen.<br><u>Kat. D</u>: der SR in dieser Gruppe war zu lange inaktiv. Er/sie darf nur mit zus&auml;tzlicher/neuer Ausbildung reaktiviert, bzw. als SR eingesetzt werden.</p><p><u>Zus&auml;tzliche Anforderungen</u>: <b>Fort- bzw. Weiterbildung ist Pflicht:</b></p>');
INSERT INTO `page_content` VALUES('38', 'schiedsrichter_page2', '3', '<ul><li>f&uuml;r Kategorie B mindestens alle 3 Jahre,</li><li>f&uuml;r Kategorie C alle 2 Jahre.</li><li>Kategorie D kann nur mehr mit Fort- bzw. Weiterbildung reaktiviert werden.</li></ul>');
INSERT INTO `page_content` VALUES('39', 'schiedsrichter_page2', '4', '<p>F&uuml;r die h&ouml;chste Turnierkategorie &Ouml;M und Staatsmeisterschaften k&ouml;nnen nur Schiedsrichter in der Kategorie A und B eingesetzt werden.</p><p>Diese Liste wurde mit Wirkung am 21.September 2010 festgelegt und ist f&uuml;r die Saison 2010/2011 g&uuml;ltig. Die Kenntnisse, neue Erfahrungen und Engagement der Schiedsrichter wird am Saisonende vom SR Referat O&Ouml; neu bewertet und entsprechend k&ouml;nnen die SR in andere Kategorie (h&ouml;here oder niedrigere) eingestuft werden.</p><p>Die Schiedsrichter (in Klub Reihenfolge) in der <u>Kategorie A</u>: Pr&ouml;ll Karl <b>ASK&Ouml; Badmintonverein Pasching</b>, B&ouml;hm Andreas, Halasz Janos, Mitterhauser Klaus <b>BSC 70 Linz</b>, Rabel Andreas <b>UBC Neuhofen</b>.</p><p>Die Schiedsrichter in der <u>Kategorie B</u>: Gr&uuml;n Johann, Reifetshammer Rudolf <b>ASK&Ouml; Traun</b>, Freim&uuml;ller Fritz, Freim&uuml;ller Tina, Keplinger Hermann, Sch&ouml;ringhumer Christian, Skovlund S&ouml;ren, Stockinger Harald, Stoiber Ulrich <b>BC Alkoven</b>, Giel Michael Peter, Hechenberger Reinhard, Steiner Reinhard <b>BSC 70 Linz</b>, Baumgartner Florian, Horninger Gerald, Retschitzegger Lukas, Retschitzegger Josef, Schausberger Hermann <b>Sportunion Ohlsdorf</b>, Eckhardt Oliver, Forstinger Manfred, Starl Harald <b>UBC Vorchdorf</b>.</p><p>Die Schiedsrichter in der <u>Kategorie C</u>: L&ouml;sch Dieter, Reifetshammer Karola <b>ASK&Ouml; Traun</b>, Aumayr Philipp, Aumayr Valerie, Freim&uuml;ller Hilde <b>BC Alkoven</b>.</p><p>Die (der) Schiedsrichter in der <u>Kategorie D</u>: Hofreiter Wolfgang <b>ATSV Steyr</b>.</p><br><p>F&uuml;rs O&Ouml;BV Schiedsrichterreferat <br>Klaus Mitterhauser und Janos Halasz</p>');
